import { Box } from "./box.model";

export class TicketBox {
  name: string;
  boxes: Box[];
  superzahl: number;
  dateCreation: Date;
  constructor(name:string, boxes:Box[],superzahl: number, dateCreation:Date) {
    this.name = name;
    this.boxes = boxes;
    this.superzahl = superzahl;
    this.dateCreation = dateCreation;
  }
}
